import React from 'react';

const Header = () => {
  return (
    <header className="bg-gray-800 py-4">
      <div className="container mx-auto flex justify-between items-center">
        <div className="text-white text-xl font-bold">Your Logo</div>
        <nav>
          <ul className="flex">
            <li className="mx-4"><a href="#" className="text-white">Home</a></li>
            <li className="mx-4"><a href="#" className="text-white">About</a></li>
            <li className="mx-4"><a href="#" className="text-white">Services</a></li>
            <li className="mx-4"><a href="#" className="text-white">Contact</a></li>
          </ul>
        </nav>
      </div>
    </header>
  );
};

export default Header;
